import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Provider } from 'react-redux';
import store from './redux/store'; // Подключите свой Redux store
import Navigation from './path/to/your/Navigation';
import Home from './path/to/your/Home';
import RegisterForm from './path/to/your/RegisterForm';
import LoginForm from './path/to/your/LoginForm';
import Contacts from './path/to/your/Contacts';

const App = () => {
  return (
    <Provider store={store}>
      <Router>
        <Navigation />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/registration" element={<RegisterForm />} />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/contacts" element={<Contacts />} />
        </Routes>
      </Router>
    </Provider>
  );
};

export default App;
